		DB::table('reviews')->insert([
			['id' => '1','reservation_id' => '10007','hotel_id' => '10005','user_from' => '10001','user_to' => '10002', 'review_by' => 'guest','rating' => '4','public_comment' => 'The view is why we booked the property and it exceeded our expectations. The pictures are an accurate representation of the lovely property. Since we were on a workcation here for 8 days, the place was perfect with a study desk, stable broadband and UPS backup. The cottage is well equipped with essential amenities. The host was very prompt and helpful. She helped arrange for a cook which was a big plus for us during covid times. Overall we had a great experience and would recommend this property to anyone looking for a getaway. We\\\'d definitely stay here again. Thank you','private_comment' => 'So glad to have found a property that I see myself going back to again and again. Despite travelling during a pandemic, the secluded location, contactless check-in, safety protocols in check instantly put me and my family at ease. The house is completely functional, stocked with appliances and basic kitchen supplies. The local tips PDF sent by our hostess upon checking in turned out to be a huge help. Albeit expensive, the location and amenities more than makeup for the prices.','recommend' => '1', 'public_reply' => 'Thank you for your review. We are happy to hear that you enjoyed the hotel overall. Thank you for staying with us!', 'feedback_to_admin' => NULL,'created_at' => '2021-10-08 08:47:51','updated_at' => '2021-10-08 08:47:51'],
